Node<K,V> hiHead = null, hiTail = null;
Node<K,V> next;
//\u5FAA\u73AF\u904D\u5386\u539F\u54C8\u5E0C\u8868\u4E2D\u7684\u6BCF\u4E2A\u5143\u7D20
do {
    next = e.next;
    //\u6839\u636E\u5F53\u524D\u5143\u7D20\u7684\u54C8\u5E0C\u503C\u4E0E\u539F\u54C8\u5E0C\u8868\u7684\u5BB9\u91CF oldCap \u8FDB\u884C\u4E0E\u8FD0\u7B97\u7684\u7ED3\u679C\uFF0C\u5C06\u5143\u7D20\u5206\u4E3A\u4E24\u7EC4\uFF0C
    // e.hash & 16 = 0 \u4F4E\u4F4D\u6307\u9488
    if ((e.hash & oldCap) == 0) {
        //\u5C06\u4F4E\u4F4D\u7684hash\u76F8\u8FDE\u5F62\u6210\u4E00\u4E2A\u94FE\u8868\uFF0CloTail\u7528\u4E8E\u6307\u5411\u5C3E\u90E8\uFF0CloHead\u6C38\u8FDC\u6307\u5411\u5934\u90E8
        //\u9AD8\u4F4D\u94FE\u63A5\u4E5F\u540C\u6837\u5904\u7406
        if (loTail == null)
            loHead = e;
        else
            loTail.next = e;
        loTail = e;
    }
    else {
        //// e.hash & 16 > 0 \u9AD8\u4F4D\u6307\u9488
        if (hiTail == null)
            hiHead = e;
        else
            hiTail.next = e;
        hiTail = e;
    }
} while ((e = next) != null);
if (loTail != null) {
    //\u5BF9\u4E8E\u4F4E\u4F4D\u94FE\u8868\u76F4\u63A5\u632A\u5230\u65B0\u6570\u7EC4\u7684\u539F\u6765\u4F4D\u7F6E
    loTail.next = null;
    newTab[j] = loHead;
}
if (hiTail != null) {
    //\u5BF9\u4E8E\u9AD8\u4F4D\u8868\u632A\u5230\u539F\u6765\u4F4D\u7F6E+\u8001\u6570\u7EC4\u957F\u5EA6\u7684\u4F4D\u7F6E
    hiTail.next = null;
    newTab[j + oldCap] = hiHead;
}
